import React from "react"
import image from "./happy.jpg"
import CardSignup from "./CardSignup"
function Image() {
    return (
    <div className="main-div" style={{position:"relative"}}>
    <div className="row" style={{display:"inline"}}>
        <div className="col-lg-6 col-md-6 col-sm-12 col-12" style={{
            }} >
            <img  src={image} alt="Photo" />
        </div>
        <div className="col-lg-6 col-md-6 col-sm-12 col-12" style={{display:"inline"}}>
        <h1 className="img-Text">We Are Positive<span style={{fontSize:"6.5rem",color:"rgb(214, 55, 55)"}}>*</span></h1>
            <p style={{fontFamily:"'Baloo Da 2', cursive",display:"inline-block",position:"absolute",top:"21rem",right:"27rem",fontWeight:"5px",color:"#679b9b"}}><span>*</span>The various ways that you keep urself Positve and Happy.<br></br>Tell us the ways you keep your mind thoughtfull and Energitic.</p>
            {/* <img style={{width:"60px" ,height:"30px"}} src={CardSignup} /> */}
            <CardSignup />

        </div>
    </div>
    </div>
    )
}
export default Image;
//fontFamily:"'Baloo Da 2'
